import React from 'react';
import { Col, Container, Row } from 'react-bootstrap';
import Button from 'react-bootstrap/Button';
import Card from 'react-bootstrap/Card';

const HistoryCard = ({hist}) => {
    return (
    <Row >
        <Col>
            <div>{hist.name}</div>
        </Col>
        <Col>
            <div>{hist.breed}</div>
        </Col>  
    </Row>
      
    );
};

export default HistoryCard;
